import React from 'react';
const Api = ({consumir, perfiles, onChange, form}) =>(
    <Fragment>
    <div className="container d-flex justify-content-center mt-5">
        <form className="form">
            <div className="form-group mt-3">
                <label>Apellido paterno:</label>
                <input onChange={onChange} value={form.paterno} className="form-control" type="text" name="paterno" />
                <button onClick={consumir} className="btn btn-success">Consumir</button>
            </div>
        </form>
    </div>
    <div className="mt-3">
            {
                perfiles.map(
                    (item, i) => (
                        <div>
                            <img src={item.avatar_url} alt="Perfil" />
                            <a target="_blank" rel="noreferrer" href={item.html_url} key={i}>{item.login}</a>
                        </div>
                    )
                )
            }
    </div>
    </Fragment>
);

export default Api;
